  exitFullscreen,
  isFullscreen,
  requestFullscreen,
} from "./fullscreen";
import hasEMEAPIs from "./has_eme_apis";
import isCodecSupported from "./is_codec_supported";
import isOffline from "./is_offline";
import isPlaybackStuck from "./is_playback_stuck";
