  ICompatMediaKeySystemAccess,
  ICompatMediaKeySystemConfiguration,
  ICompatTextTrack,
  ICompatVTTCue,
  ICustomMediaKeySession,
  ICustomMediaKeySystemAccess,
  ICustomMediaKeys,
  ICustomSourceBuffer,
  isCodecSupported,
  isFullscreen,
  isOffline,
  isPlaybackStuck,
  isVTTCue,
  makeVTTCue,
  MediaSource_,
  play$,
  requestFullscreen,
  requestMediaKeySystemAccess,
  setElementSrc$,
  setMediaKeys,
  shouldRenewMediaKeys,
  shouldUnsetMediaKeys,
  shouldValidateMetadata,
  tryToChangeSourceBufferType,
  VTTCue_,
  whenLoadedMetadata$,
  whenMediaSourceOpen$,
};
